// src/pages/Dashboard.js
import React from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
`;

const Title = styled.h1`
  margin-bottom: 20px;
`;

const Button = styled.button`
  padding: 10px 20px;
  font-size: 1rem;
  margin: 10px;
  background-color: #007bff;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #0056b3;
  }
`;

const DashboardPage = () => {
  const navigate = useNavigate();

  const handlePlanSelection = (plan) => {
    // Handle plan selection logic here
    console.log(`Selected plan: ${plan}`);
    navigate('/generate-qr');
  };

  return (
    <Container>
      <Title>Select a Plan</Title>
      <Button onClick={() => handlePlanSelection('Basic')}>Basic Plan</Button>
      <Button onClick={() => handlePlanSelection('Premium')}>Premium Plan</Button>
      <Button onClick={() => handlePlanSelection('Enterprise')}>Enterprise Plan</Button>
    </Container>
  );
};

export default DashboardPage;
